import React from "react";
import { NavbarContainer, StyledLogo } from "../styles/NavbarStyles";
import LogoSvg from "../assets/steamLogo.svg"; // Ajusta la ruta según sea necesario

function Navbar() {
  return (
    <>
      <NavbarContainer>
        {/* Asegúrate de no tener hijos aquí */}

        <StyledLogo src={LogoSvg} alt="Logo de Steam" />
        <p>Vamos a probar</p>
      </NavbarContainer>
    </>
  );
}

export default Navbar;
